    // the colors are based on the perceptual map color work of Dr. Cynthia Brewer http://colorbrewer.org
    // BuPu and OrRd are recommended for sequential data both for colorblindness scores (page 45, http://www.personal.psu.edu/cab38/ColorBrewer/Steve_Gardner_thesis_PSU.pdf) and by the team designer (Rob Ray) for look
    public class BrewerColors
    {
        public enum Scheme
        {
            Qualitative, //do not imply magnitude differences between legend classes, and hues are used to create the primary visual differences between classes. Qualitative schemes are best suited to representing nominal or categorical data
            Diverging,   //equal emphasis on mid-range critical values and extremes at both ends of the data range. The critical class or break in the middle of the legend is emphasized with light colors and low and high extremes are emphasized with dark colors that have contrasting hues
            Sequential   //ordered data that progress from low to high. Lightness steps dominate the look of these schemes, with light colors for low data values to dark colors for high data values
        };

        private struct BrewerColor
        {
            public string Name;
            public int NumColors;
            public Scheme Scheme;
            public Vector3[] Colors;
            public BrewerColor(string name, int numColors, Scheme scheme, Vector3[] colors)
            {
                Name = name;
                NumColors = numColors;
                Scheme = scheme;
                Colors = colors;
            }
        }

        private static BrewerColor[] Colors = null;
        
        public static Vector3[] GetColors(string name, int numColors)
        {
            if (Colors == null)
            {
                InitColors();
            }

            var result = Colors.Where(c => c.NumColors == numColors && c.Name == name).FirstOrDefault();
            return result.NumColors == 0 ? null : result.Colors;
        }

